package com.suneee.eas.common.bean.upload;import com.amazonaws.services.s3.model.PartETag;import org.apache.commons.lang3.builder.ToStringBuilder;import java.util.ArrayList;import java.util.List;/** * @program: eas-parent * @description: 用于村粗分段上传的标识信息 * @author: liuhai * @create: 2018-10-22 15:54 **/public class UniqueUploadInfo {    private String uploadId;    private String path;    private List<PartETag> eTagsList = new ArrayList<>();    public String getUploadId() {        return uploadId;    }    public void setUploadId(String uploadId) {        this.uploadId = uploadId;    }    public String getPath() {        return path;    }    public void setPath(String path) {        this.path = path;    }    public List<PartETag> geteTagsList() {        return eTagsList;    }    public void seteTagsList(List<PartETag> eTagsList) {        this.eTagsList = eTagsList;    }    @Override    public String toString() {        return new ToStringBuilder(this)                .append("uploadId", uploadId)                .append("path", path)                .append("eTagsList", eTagsList)                .toString();    }}